import logo from './images/react-full.png'
function Header() {
  return (
    <header className='header'>
      <div className='logo-container'>
        <img src={ logo } alt='logo' className='logo'></img>
      </div>
      <nav>
        <ul>
          <li>Pricing</li>
          <li>About</li>
          <li>Contact</li>
        </ul>
      </nav>
    </header>
  );
};

export { Header };
